INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (144, 'xtoon-gateway-server.yaml', 'DEFAULT_GROUP', 'server:\n  port: 8080\n\nspring:\n  redis:\n    host: localhost\n    port: 6379\n    password: 123456\n    database: 0\n  security:\n    oauth2:\n      resourceserver:\n        jwt:\n          # 获取JWT验签公钥请求路径\n          jwk-set-uri: \'http://localhost:8000/getPublicKey\'\n  cloud:\n    nacos:\n      discovery:\n        server-addr: localhost:8848\n    sentinel:\n      transport:\n        dashboard: localhost:5003\n    gateway:\n      routes:\n      # 认证中心\n      - id: xtoon-auth-server\n        uri: lb://xtoon-auth-server\n        predicates:\n        - Path=/auth/**\n      # 用户\n      - id: xtoon-sys-server\n        uri: lb://xtoon-sys-server\n        predicates:\n        - Path=/sys/**\n      discovery:\n        locator:\n          enabled: true\n          lowerCaseServiceId: true\n\n# 配置白名单路径\nwhite-list:\n  urls:\n  - \"/auth/**\"\n  - \"/actuator/**\"\n  - \"/v2/api-docs/**\"\n  - \"/sys/loginByAccount\"\n  - \"/assets/**\"\n  - \"/sys/captcha\"\n  - \"/sys/register/**\"', '2c1d8d0968e4302e2218b8da54b82b45', '2021-06-25 21:21:41', '2022-08-18 23:03:38', NULL, '127.0.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (145, 'xtoon-sys-server.yaml', 'DEFAULT_GROUP', 'server:\n  port: 8101\n\ndubbo:\n  application:\n    id: xtoon-sys-server\n    name: xtoon-sys-server\n    qosEnable: false\n  registry:\n    address: nacos://localhost:8848\n    check: false\n  protocol:\n    name: dubbo\n    port: -1\n\nspring:\n  datasource:\n    type: com.zaxxer.hikari.HikariDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: rr998xhz1997\n    url: jdbc:mysql://localhost:3306/xtoon-cloud?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai\n  redis:\n    host: localhost\n    port: 6379\n    password: 123456\n    database: 0\n  cloud:\n    nacos:\n      discovery:\n        server-addr: localhost:8848\n    sentinel:\n      transport:\n        dashboard: localhost:5003\n\n#mybatis\nmybatis-plus:\n  mapper-locations: classpath*:com/xtoon/cloud/**/infrastructure/persistence/mapper/xml/*Mapper.xml\n  #实体扫描，多个package用逗号或者分号分隔\n  typeAliasesPackage: com.xtoon.cloud.*.infrastructure.persistence.entity\n  global-config:\n    #数据库相关配置\n    db-config:\n      id-type: ASSIGN_ID\n      logic-delete-value: 1\n      logic-not-delete-value: 0\n      logic-delete-field: delFlag\n    banner: false\n  #原生配置\n  configuration:\n    map-underscore-to-camel-case: true\n    cache-enabled: false\n    call-setters-on-nulls: true\n    jdbc-type-for-null: \'null\'', 'a4402d068d1dad9fb7b68df4548db34e', '2021-06-25 21:22:12', '2022-08-10 15:19:24', 'nacos', '127.0.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (146, 'application-dev.yml', 'DEFAULT_GROUP', 'spring:\n  main:\n    allow-bean-definition-overriding: true\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n\n#请求处理的超时时间\nribbon:\n  ReadTimeout: 10000\n  ConnectTimeout: 10000\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', 'c07e6f7321493f6d5390d0a08bffb75a', '2019-11-29 16:31:20', '2020-12-21 15:29:24', NULL, '0:0:0:0:0:0:0:1', '', '', '通用配置', 'null', 'null', 'yaml', 'null');
INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (147, 'ruoyi-gateway-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    host: localhost\n    port: 6379\n    password: 123456\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: ruoyi-auth\n          uri: lb://ruoyi-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - CacheRequestFilter\n            - ValidateCodeFilter\n            - StripPrefix=1\n        # 代码生成\n        - id: ruoyi-gen\n          uri: lb://ruoyi-gen\n          predicates:\n            - Path=/code/**\n          filters:\n            - StripPrefix=1\n        # 定时任务\n        - id: ruoyi-job\n          uri: lb://ruoyi-job\n          predicates:\n            - Path=/schedule/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-system\n          uri: lb://ruoyi-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 文件服务\n        - id: ruoyi-file\n          uri: lb://ruoyi-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - StripPrefix=1\n\n# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    enabled: true\n    type: math\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /system/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/logout\n      - /auth/login\n      - /auth/register\n      - /*/v2/api-docs\n      - /csrf\n', 'b9d6af846735c90a3ec2b58737fa586b', '2020-05-14 14:17:55', '2022-02-04 03:40:29', 'nacos', '127.0.0.1', '', '', '网关模块', 'null', 'null', 'yaml', 'null');
