INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (156, 'regulatory-platform.yml', 'DEFAULT_GROUP', '# 项目相关配置\nruoyi:\n  # 名称\n  name: regulatory-platform\n  # 版本\n  version: 3.0.0\n  # 版权年份\n  copyrightYear: 2019\n  # 实例演示开关\n  demoEnabled: true\n  profile: /home/uploadPath\n  # 获取ip地址开关\n  addressEnabled: false\nmybatis:\n  configuration:\n    cache-enabled: false  #禁用二级缓存\n    local-cache-scope: statement  #一级缓存指定为session级别\n# 开发环境配置\nserver:\n  # 服务器的HTTP端口，默认为8080\n  port: 8080\n  servlet:\n    # 应用的访问路径\n    context-path: /\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 800\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# 日志配置\nlogging:\n  level:\n    com.itjcloud: debug\n    org.springframework: warn\n\n# Spring配置\nspring:\n  datasource:\n      type: com.alibaba.druid.pool.DruidDataSource\n      driverClassName: com.mysql.cj.jdbc.Driver\n      druid:\n          # 主库数据源\n          master:\n              url: jdbc:mysql://124.71.130.242:13306/regulatory_platform_dev?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8&allowMultiQueries=true\n              username: regulatory_platform_dev\n              password: uu85A2rt99oVniWu\n          # 从库数据源\n          slave:\n              # 从数据源开关/默认关闭\n              enabled: false\n              url:\n              username:\n              password:\n          # 初始连接数\n          initialSize: 5\n          # 最小连接池数量\n          minIdle: 10\n          # 最大连接池数量\n          maxActive: 1000\n          # 配置获取连接等待超时的时间\n          maxWait: 60000\n          # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n          timeBetweenEvictionRunsMillis: 60000\n          # 配置一个连接在池中最小生存的时间，单位是毫秒\n          minEvictableIdleTimeMillis: 300000\n          # 配置一个连接在池中最大生存的时间，单位是毫秒\n          maxEvictableIdleTimeMillis: 900000\n          # 配置检测连接是否有效\n          validationQuery: SELECT 1 FROM DUAL\n          testWhileIdle: true\n          testOnBorrow: false\n          testOnReturn: false\n          webStatFilter:\n              enabled: true\n          statViewServlet:\n              enabled: true\n              # 设置白名单，不填则允许所有访问\n              allow:\n              url-pattern: /druid/*\n              # 控制台管理用户名和密码\n              login-username:\n              login-password:\n          filter:\n              stat:\n                  enabled: true\n                  # 慢SQL记录\n                  log-slow-sql: true\n                  slow-sql-millis: 1000\n                  merge-sql: true\n              wall:\n                  config:\n                      multi-statement-allow: true\n  main:\n    allow-bean-definition-overriding: true\n  # 资源信息\n  messages:\n    # 国际化资源文件路径\n    basename: i18n/messages\n  # 文件上传\n  servlet:\n    multipart:\n      # 单个文件大小\n      max-file-size:  10MB\n      # 设置总上传的文件大小\n      max-request-size:  20MB\n  # 服务模块\n  devtools:\n    restart:\n      # 热部署开关\n      enabled: true\n  # redis 配置\n  redis:\n    # 地址\n    host: 127.0.0.1\n    # 端口，默认为6379\n    port: 6379\n    # 密码\n    password: 123456\n    # 连接超时时间\n    timeout: 10s\n    lettuce:\n      pool:\n        # 连接池中的最小空闲连接\n        min-idle: 0\n        # 连接池中的最大空闲连接\n        max-idle: 8\n        # 连接池的最大数据库连接数\n        max-active: 8\n        # #连接池最大阻塞等待时间（使用负值表示没有限制）\n        max-wait: -1ms\n\n# token配置\ntoken:\n  # 令牌自定义标识\n  header: Authorization\n  # 令牌密钥\n  secret: abcdefghijklmnopqrstuvwxyz\n  # 令牌有效期（默认30分钟）\n  expireTime: 30\n\n# MyBatis-plus配置\nmybatis-plus:\n  type-aliases-package: com.itjcloud.**.domain.**\n  mapper-locations: classpath*:mapper/**/*Mapper.xml  #pom.xml文件中添加配置\n  configLocation: classpath:mybatis/mybatis-config.xml # 加载全局的配置文件\n  global-config:\n    banner: false\n    db-config:\n      update-strategy: not_empty\n      insert-strategy: not_empty\n      where-strategy: not_empty\n      logic-delete-field: del_flag # 全局逻辑删除的实体字段名(since 3.3.0,配置后可以忽略不配置步骤2)\n      logic-not-delete-value: 0\n      logic-delete-value: UNIX_TIMESTAMP()\n    #刷新mapper 调试神器\n    refresh: true\n\n# PageHelper分页插件\npagehelper:\n  helperDialect: mysql\n  reasonable: true\n  supportMethodsArguments: true\n  params: count=countSql\n\n# Swagger配置\nswagger:\n  # 是否开启swagger\n  enabled: true\n  # 请求前缀\n  pathMapping: /dev-api\n\n# 防止XSS攻击\nxss:\n  # 过滤开关\n  enabled: true\n  # 排除链接（多个用逗号分隔）\n  excludes: /system/notice/*\n  # 匹配链接\n  urlPatterns: /system/*,/monitor/*,/tool/*\n\nthird:\n  sms:\n    #appID\n    appId: 8aaf07087de13e49017de60281c900d7\n    #生产环境请求地址\n    serverName: https://app.cloopen.com:8883/2013-12-26/Accounts/\n    #生产环境群发接口地址\n    massUrl: /SMS/TemplateSMS\n    #主账号\n    accountSid: 8a216da85afaadec015b0e9bee650650\n    #账号token\n    accountToken: eb59ceb68d9848a6ad570aeddd4d2dbe\n    notice:\n      #短信验证码模板ID\n      codeTemplateId: 1098724\n\nwx:\n  miniapp:\n    appid: wxe5af72207b5e9ea0\n    secret: 0a3bf93024ac457062c3c8caf9d98d9a\n    token: #微信小程序消息服务器配置的token\n    aesKey: #微信小程序消息服务器配置的EncodingAESKey\n    msgDataFormat: JSON\n\n#保利威视\npolyv:\n  userid: 6b2837ad02\n  secretKey: 3Fl0OlvqyC\n  writetoken: 7516bd14-5837-4165-b3e9-aaffdd66fa06\n# 数据源配置\n', '408c91c8bc248dd9dbd67d1b72da6a0e', '2022-04-09 03:02:02', '2022-04-09 03:27:31', 'nacos', '172.16.101.124', '', 'd6d8f8e5-f986-4856-a2e8-004e60cd373e', '', '', '', 'yaml', '');
