INSERT INTO `config_info` (`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (495, 'registry.conf', 'SEATA_GROUP', 'registry {\n  # file nacos\n  type = \"nacos\"\n\n  nacos {\n    serverAddr = \"127.0.0.1:8848\"\n    namespace = \"public\"\n    cluster = \"default\"\n  }\n  file {\n    name = \"file.conf\"\n  }\n}\n\nconfig {\n  # file、nacos 、apollo、zk、consul\n  type = \"nacos\"\n\n  file {\n    name = \"file.conf\"\n  }\n\n  nacos {\n    serverAddr = \"127.0.0.1:8848\"\n    namespace = \"public\"\n    cluster = \"default\"\n  }\n}', '9c2d328dd55f6c6f959397bf4126989e', '2023-02-23 11:24:55', '2023-02-23 11:26:23', 'nacos', '127.0.0.1', '', 'd6d8f8e5-f986-4856-a2e8-004e60cd373e', '', '', '', 'text', '');
